/*TABLA DIVIPOLA*/
CREATE TABLE "PRO_TT_DIVIPOLA" 
   (	"COD_DPTO" NUMBER(9,0), 
	"NOM_DPTO" VARCHAR2(100 BYTE), 
	"COD_MPIO" NUMBER(9,0) NOT NULL ENABLE, 
	"NOM_MPIO" VARCHAR2(100 BYTE), 
	"TIPO" VARCHAR2(100 BYTE), 
	"LATITUD" FLOAT(126), 
	"LONGITUD" FLOAT(126), 
	"RURALIDAD" VARCHAR2(50 BYTE), 
	"ESTADO" VARCHAR2(20 BYTE), 
	"COBERTURA" VARCHAR2(20 BYTE), 
	"SEDE_RESP" VARCHAR2(20 BYTE));
    
    

COMMIT;